export const pCOLUMNS = [
    {
        Header: "Provider",
        accessor: "PhysicianName",
    },
    {
        Header: "MemberID",
        accessor: "MemberID",
    },
    {
      Header: "Full Name",
      accessor: "Patientname",
    },
    {
        Header: "DOB",
        accessor: "Birthdate",
    },
    {
      Header: "Address",
      accessor: "PatientFullAddress",
    },
    {
      Header: "Phone",
      accessor: "PatientPhone",
    },
    {
      Header: "Gap",
      accessor: "Opengaps",
    }
  ];
